    [],nt"revision_timestamp": "2016-07-27T23:06:38.839472",nt"name": "mortality-surveillance-for-highly-pathogenic-avian-influenza-hpai-at-kulm-wetland-manageme-3a04d",nt"isopen":
    false,nt"url": null,nt"notes": "Proposal for 2010-2011 mortality surveillance
    for Highly Pathogenic Avian Influenza (HPAI) at Kulm Wetland Management District
    in North Dakota. Surveillance will focus on priority species known to be sensitive
    to HPAI. Mortality surveys will be focused on designated routes of 11 Waterfowl
    Production Areas, which have high known concentrations of the sensitive species.
    Surveillance will be conducted via ATV or foot-based observation surveys along wetlands
    on a weekly basis from roughly 15 April 2010 (ice-out) through 7 November 2010 (freeze-up)
    during the migration and throughout the breeding season. Monitoring efforts will
    continue during the following spring migration, from roughly 1-31 March. Eleven
    sites included during the 2007 - 2009 HPAI monitoring will again be surveyed in
    2010. In addition, 3-5 large wetlands (semi-permanent wetlands or permanent lakes)
    will be included for the 2010 field season due to the relative proximity to poultry
    production facilities in eastern Dickey County. Wetlands on private lands in which
    permission cannot be obtained will be scanned with a spotting scope or binoculars
    from the nearest road. Moribund avian carcasses obtained during mortality surveillance
    efforts will be collected, properly packaged, and shipped to the National Wildlife
    Health Center in Madison, WI following appropriate protocols for cause-of-death
    determination.  This proposal contains a summary of 2009-2010 surveillance.",nt"license_title":
